import React from "react";
import { FooterStyled, ContainerBg } from "./Footer.styled";


function Footer() {
  return (
  
  <>
  <ContainerBg>
  <FooterStyled>
    <p>
    Justified Development, Inc 
    PO Box 1234
    Crystal Lake, IL  60014
    </p>
  
    
  </FooterStyled> 
  </ContainerBg> 
  </>
)
}
export default Footer;
